import clsx from 'clsx';
import { Link } from 'react-router-dom';
import styles from './ButtonShow.module.scss'


const ButtonShow = (props) => {
  return (
    <Link to="/table{props.id}"><button className={clsx("btn-default, btn-lg", styles.btnshow)}>Show more</button></Link>
  )
}

export default ButtonShow;
